import styled from "styled-components";

export const NavbarContainer = styled.div`
  .container-navbar {
    background: linear-gradient(to right, #b1e2eb 0%, #1a5059 100%);
    color: rgba(255, 255, 255, 1);
    position: absolute;
    top: 0;
    width: 100%;
    padding: 10px 30px;
  }
  .mr-nav-left {
    margin-left: 100px;
  }
`;
